import React from 'react';
import Header from '../components/Home/Header';
import Menu from '../components/Home/Menu';

const Home = () => {
  const styles = {
    backgroundColor: '#000',
    border: '1px solid hsla(0,0%,100%,.1)',
    boxShadow: '0 0 20px hsla(0,0%,100%,.05)',
  };

  return (
    <div className="app" style={styles}>
      <Header />
      <Menu />
    </div>
  );
};

export default Home;
